import React from "react";
export default function Ktx() {
    return (
        <div className="lading-intro">
            <div className="flex justify-between">
                <div>
                    <p className="title">Kênh thông tin</p>
                    <p className="title2"> Ký túc xá Đại Học FPT</p>
                </div>
            </div>
        </div>
    );
}
